def antidivisors(n):
    return [2*d for d in divisors(n) if n > 2*d and n % (2*d)] + \
        [d for d in divisors(2*n-1) if n > d >=2 and n % d] + \
        [d for d in divisors(2*n+1) if n > d >=2 and n % d]
